import React from "react";
import ReviewCard from "./ReviewCard";

const ProfilePage = ({ profileReviews, onEdit, onDelete, onFavorite }) => (
  <div>
    <h2>Your Reviews & Favorites</h2>
    <div className="reviews">
      {profileReviews.length === 0 ? (
        <p>No reviews yet.</p>
      ) : (
        profileReviews.map((review) => (
          <ReviewCard
            key={review._id}
            review={review}
            onEdit={onEdit}
            onDelete={onDelete}
            onFavorite={onFavorite}
          />
        ))
      )}
    </div>
  </div>
);

export default ProfilePage;
